import React from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { useAuth } from '../App';

const TestContractRecommendation = () => {
    const { eid } = useParams();
    const navigate = useNavigate();
    const { user } = useAuth();

    return (
        <div className="container mt-4">
            <div className="card">
                <div className="card-header bg-primary text-white">
                    <h3>‚úÖ Test Contract Recommendation Page</h3>
                </div>
                <div className="card-body">
                    <div className="alert alert-primary">
                        <h4>üéâ Navigation Berhasil!</h4>
                        <p>Anda berhasil navigasi ke halaman Contract Recommendation.</p>
                    </div>
                    
                    <h5>Detail Informasi:</h5>
                    <ul>
                        <li><strong>Employee ID (EID):</strong> {eid}</li>
                        <li><strong>Current URL:</strong> {window.location.pathname}</li>
                        <li><strong>User Role:</strong> {user?.role}</li>
                        <li><strong>User Name:</strong> {user?.username}</li>
                    </ul>
                    
                    <div className="mt-4">
                        <button 
                            className="btn btn-primary me-2"
                            onClick={() => navigate('/dashboard')}
                        >
                            ‚Üê Kembali ke Dashboard
                        </button>
                        
                        <button 
                            className="btn btn-success"
                            onClick={() => navigate(`/manager/employee/${eid}`)}
                        >
                            Test Navigation ke Employee Detail
                        </button>
                    </div>
                    
                    <div className="mt-4 alert alert-info">
                        <h6>Debugging Info:</h6>
                        <pre>{JSON.stringify({
                            eid: eid,
                            userRole: user?.role,
                            pathname: window.location.pathname,
                            timestamp: new Date().toISOString()
                        }, null, 2)}</pre>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default TestContractRecommendation;
